import React from 'react'

export default function Questions({ question }) {
    return (
        <div>
            <h4>{question.question}</h4>
            <div className='options'>
                {
                    question.options.map(i => <button className='btn btn-option' key={i} >{i}</button>)
                }
            </div>
        </div>
    )
}
